import React from "react";
import {Grid} from "@material-ui/core";

const Logo = () => (
    <Grid
        container
        justify="space-around"
    >
        <Grid item sm={3}>
            <img src={require("../images/Logo1.svg")} href="#home" />
            <img src={require("../images/Logo2.svg")} href="#home" />
        </Grid>
    </Grid>
)

export default Logo;
